import React, { useEffect} from 'react'
import { useDispatch, useSelector } from 'react-redux';
import { getAllProducts } from '../store/reguests';
import ProductCard from '../components/ProductCard/ProductCard';
import SortingBlock from '../components/SortingBlock/SortingBlock';


export default function Products() {

  const dispatch = useDispatch()

  useEffect(() => dispatch(getAllProducts), [])

  const allProducts = useSelector(state => state.all_products)

  return (
    <>
      <h1 className='h2'>All products</h1>
      <SortingBlock state={allProducts} />
      <div className='cards_container'>
        {allProducts
          .filter(el => el.show_product)
          .map(el => <ProductCard key={el.id} {...el} />)
        }
      </div>      
    </>

  )
}
